window.bookSummaryJSON = "<p>Jason logs into <i>Awaken Online</i> fed-up with reality. He's in desperate need of an escape, and this game is his ticket to finally feeling the type of power and freedom that are so sorely lacking in his real life. </p> <p><i>Awaken Online</i> is a brand new virtual reality game that just hit the market, promising an unprecedented level of immersion. Yet Jason quickly finds himself pushed down a path he didn't expect. In this game, he isn't the hero. There are no damsels to save. There are no bad guys to vanquish. </p> <p>In fact, he might just be the villain. </p>"; 
